orm-check-label\">Head of Household (HOH)</label></div><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"filing_status\" value=\"Qualifying surviving spouse\" class=\"form-check-input\" ><label for=\'filing_status\' class=\"form-check-label\">Qualifying surviving spouse (QSS)</label></div><div class=\'  row w-auto\'><p >If you checked the MFS box, enter the name of your spouse. If you checked the HOH or QSS box, enter the child\'s name if the qualifying person is a child but not your dependent:</p><input type=\"text\" name=\"child_name\" value=\"\" class=\"form-control form-control-sm w-75\" aria-label=\"child name\"></div></div><hr class=\"mx-auto mt-3\"></hr></div></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col col-md-5\'><div class=\'  form-floating\'><input type=\"text\" name=\"firstname\" value=\"\" class=\"form-control\"><label for=\'firstname\' >Your First name and Middle initial</label></div></div><div class=\'  col col-md-4\'><div class=\'  form-floating\'><input type=\"text\" name=\"lastname\" value=\"\" class=\"form-control\"><label for=\'lastname\' >Last Name</label></div></div><div class=\'  col col-md-3\'><div class=\'  form-floating\'><input type=\"text\" name=\"securitynumber\" value=\"\" class=\"form-control\"><label for=\'securitynumber\' >  Your Social Security Number</label></div></div><hr class=\"mx-auto mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col col-md-5\'><div class=\'  form-floating\'><input type=\"text\" name=\"spouse-firstname\" value=\"\" class=\"form-control\"><label for=\'spouse-firstname\' >If joint return, spouse\'s first name and middle initial</label></div></div><div class=\'  col col-md-4\'><div class=\'  form-floating\'><input type=\"text\" name=\"spouse-lastname\" value=\"\" class=\"form-control\"><label for=\'spouse-lastname\' >Last Name</label></div></div><div class=\'  col col-md-3\'>