SR</label></div></div><div class=\'  col-md-2\'><div class=\'  form-floating\'><input type=\"text\" name=\"ssn\" value=\"\" class=\"form-control form-control-sm\" id=\"ssn\" placeholder=\"ssn\"><label for=\'ssn\' for=\"name\">Your Social Security Number</label></div></div></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><h5 >Medical and Dental Expenses</h5></div><div class=\'  col-md-10\'><div class=\'  row\'><p >Caution: Do not include expenses reimbursed or paid by others.</p></div><div class=\'  row\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"1\" value=\"\" class=\"form-control form-control-sm\" id=\"1\" placeholder=\"1\"><label for=\'1\' for=\"1\">1. Medical and dental expenses (see instructions)</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"2\" value=\"\" class=\"form-control form-control-sm\" id=\"2\" placeholder=\"2\"><label for=\'2\' for=\"2\">2. Enter amount from Form 1040 or 1040-SR, line 11</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"3\" value=\"\" class=\"form-control form-control-sm\" id=\"3\" placeholder=\"3\"><label for=\'3\' for=\"3\">3. Multiply line 2 by 7.5% (0.075)</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"4\" value=\"\" class=\"form-control form-control-sm\" id=\"4\" placeholder=\"4\"><label for=\'4\' for=\"4\">4. Subtract line 3 from line 1. If line 3 is more than line 1, enter -0-</label></div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><h5 >Taxes You Paid</h5></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><p >5. State and local taxes.</p></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-check form-check-inline\'><input type=\"checkbox\" name=\"5a\" value=\"5a\" class=\"form-check-input\" ><label for=\'5a\' class=\"form-check-label\">5a. State and local income taxes or general sales taxes. You may include either income taxes or general sales taxes on line 5a, but not both. If you elect to include general sales taxes instead of income taxes, check this box</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"5b\" value=\"\" class=\"form-control form-control-sm\" id=\"5b\" placeholder=\"5b\"><label for=\'5b\' for=\"5b\">5b. State and local real estate taxes (see instructions)</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"5c\" value=\"\" class=\"form-control form-control-sm\" id=\"5c\" placeholder=\"5c\"><label for=\'5c\' for=\"5c\">5c. State and local personal property taxes</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"5d\" value=\"\" class=\"form-control form-control-sm\" id=\"5d\" placeholder=\"5d\"><label for=\'5d\' for=\"5d\">5d. Add lines 5a through 5c</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"5e\" value=\"\" class=\"form-control form-control-sm\" id=\"5e\" placeholder=\"5e\"><label for=\'5e\' for=\"5e\">5e. Enter the smaller of line 5d or $10,000 ($5,000 if married filing separately)</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"6\" value=\"\" class=\"form-control form-control-sm\" id=\"6\" placeholder=\"6\"><label for=\'6\' for=\"6\">6. Other taxes. List type and amount:</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"7\" value=\"\" class=\"form-control form-control-sm\" id=\"7\" placeholder=\"7\"><label for=\'7\' for=\"7\">7. Add lines 5e and 6</label></div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><div class=\'  row mt-2\'><h5 >Interest You Paid</h5></div><div class=\'  row mt-2\'><p >Caution: Your mortgage interest deduction may be limited. See instructions.</p></div></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-check form-check-inline\'><input type=\"checkbox\" name=\"8\" value=\"8\" class=\"form-check-input\" ><label for=\'8\' class=\"form-check-label\">Home mortgage interest and points. If you didn\'t use all of your homemortgage loan(s) to buy, build, or improve your home, see instructions and check this box</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"8a\" value=\"\" class=\"form-control form-control-sm\" id=\"8a\" placeholder=\"8a\"><label for=\'8a\' for=\"8a\">8a. Home mortgage interest and points reported to you on Form 1098. See instructions if limited</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"8b\" value=\"\" class=\"form-control form-control-sm\" id=\"8b\" placeholder=\"8b\"><label for=\'8b\' for=\"8b\">8b. Home mortgage interest not reported to you on Form 1098. See instructions if limited. If paid to the person from whom you bought thehome, see instructions and show that person\'s name, identifying no., and address</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"8b\" value=\"\" class=\"form-control form-control-sm\" id=\"8b\" placeholder=\"8b\"><label for=\'8b\' for=\"8b\">8b. Home mortgage interest not reported to you on Form 1098. See instructions if limited. If paid to the person from whom you bought thehome, see instructions and show that person\'s name, identifying no., and address</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"8c\" value=\"\" class=\"form-control form-control-sm\" id=\"8c\" placeholder=\"8c\"><label for=\'8c\' for=\"8c\">8c. Points not reported to you on Form 1098. See instructions for special rules</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"8d\" value=\"\" class=\"form-control form-control-sm\" id=\"8d\" placeholder=\"8d\"><label for=\'8d\' for=\"8d\">8d. Reserved for future use</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"8e\" value=\"\" class=\"form-control form-control-sm\" id=\"8e\" placeholder=\"8e\"><label for=\'8e\' for=\"8e\">8e. Add lines 8a through 8c</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"9\" value=\"\" class=\"form-control form-control-sm\" id=\"9\" placeholder=\"9\"><label for=\'9\' for=\"9\">9. Investment interest. Attach Form 4952 if required. See instructions</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"10\" value=\"\" class=\"form-control form-control-sm\" id=\"10\" placeholder=\"10\"><label for=\'10\' for=\"10\">10. Add lines 8e and 9</label></div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><div class=\'  row mt-2\'><h5 >Gifts To Charity</h5></div><div class=\'  row mt-2\'><p >Caution: If you made a gift and got a benefit for it, see instructions</p></div></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"11\" value=\"\" class=\"form-control form-control-sm\" id=\"11\" placeholder=\"11\"><label for=\'11\' for=\"11\">11. Gifts by cash or check. If you made any gift of $250 or more, see instructions</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"12\" value=\"\" class=\"form-control form-control-sm\" id=\"12\" placeholder=\"12\"><label for=\'12\' for=\"12\">12. Other than by cash or check. If you made any gift of $250 or more, see instructions. You must attach Form 8283 if over $500</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"13\" value=\"\" class=\"form-control form-control-sm\" id=\"13\" placeholder=\"13\"><label for=\'13\' for=\"13\">13. Carryover from prior year</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"14\" value=\"\" class=\"form-control form-control-sm\" id=\"14\" placeholder=\"14\"><label for=\'14\' for=\"14\">14. Add lines 11 through 13</label></div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><h5 >Casualty and Theft Losses</h5></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"15\" value=\"\" class=\"form-control form-control-sm\" id=\"15\" placeholder=\"15\"><label for=\'15\' for=\"15\">15. Casualty and theft loss(es) from a federally declared disaster (other than net qualified disaster losses). Attach Form 4684 and enter the amount from line 18 of that form. See instructions</label></div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><h5 >Other Itemized Deductions</h5></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"16\" value=\"\" class=\"form-control form-control-sm\" id=\"16\" placeholder=\"16\"><label for=\'16\' for=\"16\">16. Otherfrom list in instructions. List type and amount:</label></div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><h5 >Total Itemized Deductions</h5></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"17\" value=\"\" class=\"form-control form-control-sm\" id=\"17\" placeholder=\"17\"><label for=\'17\' for=\"17\">17. Add the amounts in the far right column for lines 4 through 16. Also, enter this amount on Form 1040 or 1040-SR, line 12</label></div></div></div><div class=\'  form-check form-check-inline\'><input type=\"checkbox\" name=\"18\" value=\"18\" class=\"form-check-input\" ><label for=\'18\' class=\"form-check-label\">18. If you elect to itemize deductions even though they are less than your standard deduction, check this box</label></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-auto\'><h7 >For Paperwork Reduction Act Notice, see the Instructions for Form 1040.</h7></div><div class=\'  col-auto\'><h7 >Cat. No. 17145C</h7></div><div class=\'  col-auto\'><h7 class=\"text-end\">Schedule A (Form 1040) 2022</h7></div></div><div style=\"text-align: center; padding: 20px 0;\">\n                    <button type=\"submit\" class=\"btn btn-primary\">Submit</button>\n                </div>\n                </form>\";',1,NULL,NULL),(60,'Schedule B','2022.1','2023-07-20 20:50:38','Schedule B of F1040',_binary 's:7841:\"<form action=\"/users/submit\" method=\"post\" ><div class=\'  row d-flex justify-content-center align-items-end mx-auto w-75 text-start\'><div class=\'  col-md-2\'><div class=\'  row\'><h5 >SCHEDULE B</h5></div><div class=\'  row\'><h5 >Form 1040</h5></div><div class=\'  row\'><h7 >Department of the Treasury Internal Revenue Service</h7></div></div><div class=\'  col-md-8 text-center\'><div class=\'  row\'><h3 >Interest and Ordinary Dividends</h3></div><div class=\'  row\'><h7 >Go to www.irs.gov/ScheduleB for instructions and the latest information.</h7></div><div class=\'  row\'><h7 >Attach to Form 1040 or 1040-SR</h7></div></div><div class=\'  col-md-2 text-center\'><div class=\'  row\'><h7 >OMB No. 1545-0074</h7></div><div class=\'  row\'><h7 >2022</h7></div></div><hr class=\"mx-auto mt-2 w-80\"></hr></div><div class=\'  row d-flex justify-content-center align-items-end mx-auto w-75 text-start pb-3\'><div class=\'  col-md-10\'><div class=\'  form-floating\'><input type=\"text\" name=\"name\" value=\"\" class=\"form-control form-control-sm\" id=\"name\" placeholder=\"name\"><label for=\'name\' for=\"name\">Name(s) shown on return</label></div></div><div class=\'  col-md-2 \'><div class=\'  form-floating\'><input type=\"text\" name=\"ssn\" value=\"\" class=\"form-control form-control-sm\" id=\"ssn\" placeholder=\"ssn\"><label for=\'ssn\' for=\"name\">Your Social Security Number</label></div></div></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><div class=\'  row mt-2\'><h5 >Part I: Interest</h5></div><div class=\'  row mt-2\'><p >(See instructions and the Instructions for Form 1040, line 2b.)</p></div><div class=\'  row mt-2\'><p >Note: If you received a Form 1099-INT, Form 1099-OID, or substitute statement from a brokerage firm, list the firm\'s name as the payer and enter the total interest shown on that form.</p></div></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  mb-2\'><label for=\'1\' for=\"1\">1. List name of payer. If any interest is from a seller-financed mortgage and thebuyer used the property as a personal residence, see the instructions and list thisinterest first. Also, show that buyer\'s social security number and address:</label><textarea name=\"1\" value=\"\" class=\"form-control\" id=\"1\" rows=\"14\"></textarea></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"2\" value=\"\" class=\"form-control form-control-sm\" id=\"2\" placeholder=\"2\"><label for=\'2\' for=\"2\">2. Add the amounts on line 1</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"3\" value=\"\" class=\"form-control form-control-sm\" id=\"3\" placeholder=\"3\"><label for=\'3\' for=\"3\">3. Excludable interest on series EE and I U.S. savings bonds issued after 1989. Attach Form 8815</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"4\" value=\"\" class=\"form-control form-control-sm\" id=\"4\" placeholder=\"4\"><label for=\'4\' for=\"4\">4.  Subtract line 3 from line 2. Enter the result here and on Form 1040 or 1040-SR, line 2b</label></div><div class=\'  form-text\'>Note: If line 4 is over $1,500, you must complete Part III.</div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><div class=\'  row mt-2\'><h5 >Part II: Ordinary Dividends</h5></div><div class=\'  row mt-2\'><p >(See instructions and the Instructions for Form 1040, line 3b.)</p></div><div class=\'  row mt-2\'><p >Note: If you received a Form 1099-DIV or substitute statement from a brokerage firm, list the firm\'s name as the payer and enter the ordinary dividends shown on that form.</p></div></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  mb-2\'><label for=\'5\' for=\"5\">5. List name of payer</label><textarea name=\"5\" value=\"\" class=\"form-control\" id=\"5\" rows=\"14\"></textarea></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"6\" value=\"\" class=\"form-control form-control-sm\" id=\"6\" placeholder=\"6\"><label for=\'6\' for=\"6\">6. Add the amounts on line 5. Enter the total here and on Form 1040 or 1040-SR, line 3b</label></div><div class=\'  form-text\'>If line 6 is over $1,500, you must complete Part III.</div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><div class=\'  row mt-2\'><h5 >Part III: Foreign Accounts and Trusts</h5></div><div class=\'  row\'><p >Caution: If required, failure to file FinCEN Form 114 may result in substantial penalties. Additionally, you may be required to file Form 8938, Statement of Specified Foreign Financial Assets. See instructions.</p></div></div><div class=\'  col-md-10\'><div class=\'  row\'><div class=\'  col-md-12\'><p >You must complete this part if you (a) had over $1,500 of taxable interest or ordinary dividends; (b) had a foreign account; or (c) received a distribution from, or were a grantor of, or a transferor to, a foreign trust.</p></div></div><hr class=\"mt-3\"></hr><div class=\'  row mt-2\'><div class=\'  col-md-12\'><p >a. At any time during 2022, did you have a financial interest in or signature authority over a financialaccount (such as a bank account, securities account, or brokerage account) located in a foreigncountry? See instructions</p><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"7a_radio\" value=\"Yes\" class=