ved for future use</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"8e\" value=\"\" class=\"form-control form-control-sm\" id=\"8e\" placeholder=\"8e\"><label for=\'8e\' for=\"8e\">8e. Add lines 8a through 8c</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"9\" value=\"\" class=\"form-control form-control-sm\" id=\"9\" placeholder=\"9\"><label for=\'9\' for=\"9\">9. Investment interest. Attach Form 4952 if required. See instructions</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"10\" value=\"\" class=\"form-control form-control-sm\" id=\"10\" placeholder=\"10\"><label for=\'10\' for=\"10\">10. Add lines 8e and 9</label></div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><div class=\'  row mt-2\'><h5 >Gifts To Charity</h5></div><div class=\'  row mt-2\'><p >Caution: If you made a gift and got a benefit for it, see instructions</p></div></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"11\" value=\"\" class=\"form-control form-control-sm\" id=\"11\" placeholder=\"11\"><label for=\'11\' for=\"11\">11. Gifts by cash or check. If you made any gift of $250 or more, see instructions</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"12\" value=\"\" class=\"form-control form-control-sm\" id=\"12\" placeholder=\"12\"><label for=\'12\' for=\"12\">12. Other than by cash or check. If you made any gift of $250 or more, see instructions. You must attach Form 8283 if over $500</label></div></div></div><div class=\'  row mt-2\'><di