-floating\'><input type=\"text\" name=\"17\" value=\"\" class=\"form-control form-control-sm\" id=\"17\" placeholder=\"17\"><label for=\'17\' for=\"17\">17. Add the amounts in the far right column for lines 4 through 16. Also, enter this amount on Form 1040 or 1040-SR, line 12</label></div></div></div><div class=\'  form-check form-check-inline\'><input type=\"checkbox\" name=\"18\" value=\"18\" class=\"form-check-input\" ><label for=\'18\' class=\"form-check-label\">18. If you elect to itemize deductions even though they are less than your standard deduction, check this box</label></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-auto\'><h7 >For Paperwork Reduction Act Notice, see the Instructions for Form 1040.</h7></div><div class=\'  col-auto\'><h7 >Cat. No. 17145C</h7></div><div class=\'  col-auto\'><h7 class=\"text-end\">Schedule A (Form 1040) 2022</h7></div></div><div style=\"text-align: center; padding: 20px 0;\">\r\n                    <button type=\"submit\" class=\"btn btn-primary\">Submit</button>\r\n                </div>\r\n                </form>\";',1,NULL,NULL),(70,'DEMO f1040sb','2022.1','2023-07-21 02:22:19','DEMO',_binary 's:7839:\"<form action=\"/form/70\" method=\"post\" ><div class=\'  row d-flex justify-content-center align-items-end mx-auto w-75 text-start\'><div class=\'  col-md-2\'><div class=\'  row\'><h5 >SCHEDULE B</h5></div><div class=\'  row\'><h5 >Form 1040</h5></div><div class=\'  row\'><h7 >Department of the Treasury Internal Revenue Service</h7></div></div><div class=\'  col-md-8 text-center\'><div class=\'  row\'><h3 >Interest and Ordinary Dividends</h3></div><div class=\'  row\'><h7 >Go to www.irs.gov/ScheduleB for instructions and the latest information.</h7></div><div class=\'  row\'><h7 >Attach to Form 1040 or 1040-SR</h7></div></div><div class=\'  col-md-2 text-center\'><div class=\'  row\'><h7 >OMB No. 1545-0074</h7></div><div class=\'  row\'><h7 >2022</h7></div></div><hr class=\"mx-auto mt-2 w-80\"></hr></div><div class=\'  row d-flex justify-content-center align-items-end mx-auto w-75 text-start pb-3\'><div class=\'  col-md-10\'><div class=\'  form-floating\'><input type=\"text\" name=\"name\" value=\"\" class=\"form-control form-control-sm\" id=\"name\" placeholder=\"name\"><label for=\'name\' for=\"name\">Name(s) shown on return</label></div></div><div class=\'  col-md-2 \'><div class=\'  form-floating\'><input type=\"text\" name=\"ssn\" value=\"\" class=\"form-control form-control-sm\" id=\"ssn\" placeholder=\"ssn\"><label for=\'ssn\' for=\"name\">Your Social Security Number</label></div></div></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><div class=\'  row mt-2\'><h5 >Part I: Interest</h5></div><div class=\'  row mt-2\'><p >(See instructions and the Instructions for Form 1040, line 2b.)</p></div><div class=\'  row mt-2\'><p >Note: If you received a Form 1099-INT, Form 1099-OID, or substitute statement from a brokerage firm, list the firm\'s name as the payer and enter the total interest shown on that form.</p></div></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  mb-2\'><label for=\'1\' for=\"1\">1. List name of payer. If any interest is from a seller-financed mortgage and thebuyer used the property as a personal residence, see the instructions and list thisinterest first. Also, show that buyer\'s social security number and address:</label><textarea name=\"1\" value=\"\" class=\"form-control\" id=\"1\" rows=\"14\"></textarea></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"2\" value=\"\" class=\"form-control form-control-sm\" id=\"2\" placeholder=\"2\"><label for=\'2\' for=\"2\">2. Add the amounts on line 1</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"3\" value=\"\" class=\"form-control form-control-sm\" id=\"3\" placeholder=\"3\"><label for=\'3\' for=\"3\">3. Excludable interest on series EE and I U.S. savings bonds issued after 1989. Attach Form 8815</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"4\" value=\"\" class=\"form-control form-control-sm\" id=\"4\" placeholder=\"4\"><label for=\'4\' for=\"4\">4.  Subtract line 3 from line 2. Enter the result here and on Form 1040 or 1040-SR, line 2b</label></div><div class=\'  form-text\'>Note: If line 4 is over $1,500, you must complete Part III.</div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><div class=\'  row mt-2\'><h5 >Part II: Ordinary Dividends</h5></div><div class=\'  row mt-2\'><p >(See instructions and the Instructions for Form 1040, line 3b.)</p></div><div class=\'  row mt-2\'><p >Note: If you received a Form 1099-DIV or substitute statement from a brokerage firm, list the firm\'s name as the payer and enter the ordinary dividends shown on that form.</p></div></div><div class=\'  col-md-10\'><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  mb-2\'><label for=\'5\' for=\"5\">5. List name of payer</label><textarea name=\"5\" value=\"\" class=\"form-control\" id=\"5\" rows=\"14\"></textarea></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"6\" value=\"\" class=\"form-control form-control-sm\" id=\"6\" placeholder=\"6\"><label for=\'6\' for=\"6\">6. Add the amounts on line 5. Enter the total here and on Form 1040 or 1040-SR, line 3b</label></div><div class=\'  form-text\'>If line 6 is over $1,500, you must complete Part III.</div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-2 text-start\'><div class=\'  row mt-2\'><h5 >Part III: Foreign Accounts and Trusts</h5></div><div class=\'  row\'><p >Caution: If required, failure to file FinCEN Form 114 may result in substantial penalties. Additionally, you may be required to file Form 8938, Statement of Specified Foreign Financial Assets. See instructions.</p></div></div><div class=\'  col-md-10\'><div class=\'  row\'><div class=\'  col-md-12\'><p >You must complete this part if you (a) had over $1,500 of taxable interest or ordinary dividends; (b) had a foreign account; or (c) received a distribution from, or were a grantor of, or a transferor to, a foreign trust.</p></div></div><hr class=\"mt-3\"></hr><div class=\'  row mt-2\'><div class=\'  col-md-12\'><p >a. At any time during 2022, did you have a financial interest in or signature authority over a financialaccount (such as a bank account, securities account, or brokerage account) located in a foreigncountry? See instructions</p><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"7a_radio\" value=\"Yes\" class=\"form-check-input\" ><label for=\'7a_radio\' class=\"form-check-label\">Yes</label></div><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"7a_radio\" value=\"No\" class=\"form-check-input\" ><label for=\'7a_radio\' class=\"form-check-label\">No</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><p >If Yes, are you required to file FinCEN Form 114, Report of Foreign Bank and FinancialAccounts (FBAR), to report that financial interest or signature authority? See FinCEN Form 114 and its instructions for filing requirements and exceptions to those requirements.</p></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><div class=\'  form-floating\'><input type=\"text\" name=\"7b\" value=\"\" class=\"form-control form-control-sm\" id=\"7b\" placeholder=\"7b\"><label for=\'7b\' for=\"7b\">7b. If you are required to file FinCEN Form 114, list the name(s) of the foreign country(-ies) where the financial account(s) are located:</label></div></div></div><div class=\'  row mt-2\'><div class=\'  col-md-12\'><p >If Yes, are you required to file FinCEN Form 114, Report of Foreign Bank and FinancialAccounts (FBAR), to report that financial interest or signature authority? See FinCEN Form 114 and its instructions for filing requirements and exceptions to those requirements.</p><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"8_radio\" value=\"Yes\" class=\"form-check-input\" ><label for=\'8_radio\' class=\"form-check-label\">Yes</label></div><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"8_radio\" value=\"No\" class=\"form-check-input\" ><label for=\'8_radio\' class=\"form-check-label\">No</label></div></div></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-auto\'><h7 >For Paperwork Reduction Act Notice, see the Instructions for Form 1040.</h7></div><div class=\'  col-auto\'><h7 >Cat. No. 17146N</h7></div><div class=\'  col-auto\'><h7 class=\"text-end\">Schedule B (Form 1040) 2022</h7></div></div><div style=\"text-align: center; padding: 20px 0;\">\r\n                    <button type=\"submit\" class=\"btn btn-primary\">Submit</button>\r\n                </div>\r\n                </form>\";',1,NULL,NULL),(72,'F1040 with Rules','2022.1','2023-07-21 15:36:56','with rules',_binary 's:39960:\"<form action=\"/users/submit\" method=\"post\" enctype=\"multipart/form-data\" accept-charset=\"utf-8\"><div class=\'  row d-flex justify-content-center align-items-end mx-auto w-75 text-start\'><div class=\'  col col-auto\'><h4 >Form 1040</h4></div><div class=\'  col col-auto\'><div class=\'  row\'><h6 >Department of the Treasury - Internal Revenue Service</h6></div><div class=\'  row\'><h6 >U.S. Individual Income Tax Return</h6></div></div><div class=\'  col col-auto\'><h6 >2022</h6></div><div class=\'  col col-auto\'><h6 >OMB No. 1545-0074</h6></div><div class=\'  col col-auto\'><h6 >IRS Use Only - Do not write or staple in this space.</h6></div><hr class=\"mx-auto mt-2 w-80\"></hr></div><div class=\'  \'><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-auto align-items-start mx-1\'><div class=\'  row align-items-start\'><h5 >Filing Status</h5></div><div class=\'  row\'><p >Check only one box.</p></div></div><div class=\'  col-md-8\'><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"filing_status\" value=\"Single\" class=\"form-check-input\" checked><label for=\'filing_status\' class=\"form-check-label\">Single</label></div><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"filing_status\" value=\"Married filing jointly\" class=\"form-check-input\" ><label for=\'filing_status\' class=\"form-check-label\">Married filing jointly</label></div><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"filing_status\" value=\"Married filing separately\" class=\"form-check-input\" ><label for=\'filing_status\' class=\"form-check-label\">Married filing separately (MFS)</label></div><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"filing_status\" value=\"Head of Household\" class=\"form-check-input\" ><label for=\'filing_status\' class=\"form-check-label\">Head of Household (HOH)</label></div><div class=\'  form-check form-check-inline\'><input type=\"radio\" name=\"filing_status\" value=\"Qualifying surviving spouse\" class=\"form-check-input\" ><label for=\'filing_status\' class=\"form-check-label\">Qualifying surviving spouse (QSS)</label></div><div class=\'  row w-auto\'><p >If you checked the MFS box, enter the name of your spouse. If you checked the HOH or QSS box, enter the child\'s name if the qualifying person is a child but not your dependent:</p><input type=\"text\" name=\"child_name\" value=\"\" class=\"form-control form-control-sm w-75\" aria-label=\"child name\"></div></div><hr class=\"mx-auto mt-3\"></hr></div></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col col-md-5\'><div class=\'  form-floating\'><input type=\"text\" name=\"firstname\" value=\"\" class=\"form-control\"><label for=\'firstname\' >Your First name and Middle initial</label></div></div><div class=\'  col col-md-4\'><div class=\'  form-floating\'><input type=\"text\" name=\"lastname\" value=\"\" class=\"form-control\"><label for=\'lastname\' >Last Name</label></div></div><div class=\'  col col-md-3\'><div class=\'  form-floating\'><input type=\"text\" name=\"securitynumber\" value=\"\" class=\"form-control\"><label for=\'securitynumber\' >  Your Social Security Number</label></div></div><hr class=\"mx-auto mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col col-md-5\'><div class=\'  form-floating\'><input type=\"text\" name=\"spouse-firstname\" value=\"\" class=\"form-control\"><label for=\'spouse-firstname\' >If joint return, spouse\'s first name and middle initial</label></div></div><div class=\'  col col-md-4\'><div class=\'  form-floating\'><input type=\"text\" name=\"spouse-lastname\" value=\"\" class=\"form-control\"><label for=\'spouse-lastname\' >Last Name</label></div></div><div class=\'  col col-md-3\'><div class=\'  form-floating\'><input type=\"text\" name=\"spouse-securitynumber\" value=\"\" class=\"form-control\"><label for=\'spouse-securitynumber\' >Spouse\'s Social Security Number</label></div></div><hr class=\"mx-auto mt-3\"></hr></div><div class=\'  row d-flex justify-content-center mx-auto w-75 text-start\'><div class=\'  col-md-9\'><div class=\'  row\'><div class=\'  col-md-10\'><div class=\'  form-floating\'><input type=\"text\" name=\"home_address\" value=\"\" class=\"form-control form-control-sm\" id=\"floatingInput\" placeholder=\"Home address\"><label for=\'floatingInput\' for=\"floatingInput\">Home address (number and street). If you have a P.O. box, see instructions.</label></div></div><div class=\'  col-md-2\'><div class=\'  form-floating\'><input type=\"text\" name=\"apt_no\" value=\"\" class=\"form-control form-control-sm\" id=\"floatingInputApt\" placeholder=\"apt no\"><label for=\'floatingInputApt\' for=\"floatingInputApt\">Apt no.</label></div></div></div><hr class=\"mx-auto mt-3\"></hr><div class=\'  row\'><div class=\'  col-md-8\'><div class=\'  form-floating\'><input type=\"text\" name=\"city\" value=\"\" class=\"form-control form-control-sm\" id=\"floatingInputCity\" placeholder=\"city\"><label for=\'floatingInputCity\' for=\"floatingInputCity\">City, town, or post office.</label></div></div><div class=\'  col-md-2\'><div class=\'  form-floating\'><input type=\"text\" name=\"state\" value=\"\" class=\"form-control form-control-sm\" id=\"floatingInputState\" placeholder=\"state\"><label for=\'floatingInputState\' for=\"floatingInputState\">State</label></div></div><div class=\'  col-md-2\'><div class=\'  form-floating\'><input type=\"text\" name=\"zipCode\" value=\"\" class=\"form-control form-control-sm\" id=\"floatingInputZip\" placeholder=\"zip\"><label for=\'floatingInputZip\' for=\"floatingInputZip\">ZIP Code</label></div></div><hr class=\"mt-3\"></hr></div><div class=\'  row\'><div class=\'  form-text\'>If you have a foreign address, also complete space below:</div></div><div class=\'  row\'><div class=\'  col-md-5\'><div class=\'  form-floating\'><input type=\"text\" name=\"foreignCountry\" value=\"\" class=\"form-control form-control-sm\" id=\"floatingInputForeignCountry\" placeholder=\"foreign country\"><label for=\'floatingInputForeignCountry\' for=\"floatingInputForeignCountry\">Foreign Country Name</label></div></div><div class=\'  col-md-4\'><div class=\'  form-floating\'><input type=\"text\" name=\"foreignState\" value=\"\" class=\"form-control form-control-sm\"